    <div className="container aboutme_container">
      <div className="row">
        <div className="col-md-8 description_box">
          <h1>Meet Peterz</h1>
        </div>
      </div>
      <div className="col-md-4">
        <img src="" alt="" />
      </div>
    </div>
  );
}
